import React from 'react';
import './burger-menu.css';

const BurgerMenu = ({onBtnClickHandler}) => {
    let classNames = 'burger-menu';

    const menu = () => {
        return (<ul className={classNames}>
            <li>Популярные рейсы</li>
            <li>Расписание рейсов</li>
            <li>Забронированные рейсы</li>
            <li>Вход для партнеров</li>
            <li>О компании</li>
            <li>Контакты</li>
        </ul>)
    };
    return (
        <div className="burger-menu__button" onClick={onBtnClickHandler}>
            {menu}
        </div>
    )
};
export default BurgerMenu;
